def strlen(string: str) -> int:
    """ Return length of given string
    >>> strlen('')
    0
    >>> strlen('abc')
    3
    """
    if string is None:
        return 0
    if isinstance(string, bytes):
        return len(string)
    return len(string.encode('utf-8'))

